// @ts-nocheck
import React, { ReactNode, HTMLAttributes } from 'react';
import { createComponent } from '../lib';
import type { JSX } from '@vime/core/dist/types';

import { 
  VmLoadingScreen 
} from '@vime/core';

import { define } from '../lib';


define('vm-loading-screen', VmLoadingScreen);


export interface LoadingScreenProps extends JSX.VmLoadingScreen, HTMLAttributes<HTMLVmLoadingScreenElement> {
  children?: ReactNode | ReactNode[]
};

export default createComponent<HTMLVmLoadingScreenElement, LoadingScreenProps>(
  'vm-loading-screen',
  new Set(['playbackReady','hideDots']),
);
